/* Format data from json file into cards */
const CompanyList = ({ users }) => {
    return (
      <div class="container">
        {users.map(
          (user) => (
            <div key={user.id} class="card">
                <p>{user.Name}</p>
            </div>
          )
        )}
      </div>
    );
  };

  export default CompanyList;
